import React, { Component } from 'react';
import {Route, Switch }from 'react-router-dom';

import Profile from '../pages/User/Profile'

class UserRoutes extends Component {
    render (){
        return(
            <Switch>
                <Route exact path="/" com={Profile}/>
            </Switch>
        )
    }
}
